import PostListItem from "~/components/custom/Cards/PostListItem.vue";
import TagFilterHeader from "~/components/custom/TagFilterHeader.vue";
import Pagination from "~/components/custom/Pagination.vue";
export default {
  components: {
    PostListItem,
    TagFilterHeader,
    Pagination
  },

  data() {
    return {
      selected: "All"
    };
  },

  methods: {
    resetAll() {
      this.selected = "All";
    }

  },
  computed: {
    tags() {
      var res = [{
        title: "All",
        path: "/partners"
      }];
      this.$page.tags.edges.forEach(edge => res.push({
        title: edge.node.title,
        path: edge.node.path
      }));
      return res;
    },

    baseurl() {
      return "/partners/";
    }

  }
};
